import '/Users/pernilla/Documents/portfolio/portfolio/src/App.css';
import useStyles from "./styles";
import {Nav, NavLink, Bars, NavMenu} from "./elements";


function Navbar({toggle}) {
    const classes = useStyles();

    return (
        <>
            <Nav>
                <NavLink to="/">
                    <img src="./logo.png" className={classes.logo}></img>
                    {/* <p className={classes.font}>pesjo</p> */}
                </NavLink>
                <Bars size={30} onClick={toggle}>
                </Bars>
                <NavMenu>
                    <NavLink to="/" activeStyle>
                        WORK
                </NavLink>
                    <NavLink to="/about" activeStyle>
                        ABOUT
                </NavLink>
                </NavMenu>

            </Nav>
        </>



    );
}

export default Navbar;
